    { fruitName: "apple", id: 1 },
    { fruitName: "apple", id: 2 },
    { fruitName: "plum", id: 3 },
  ]);
  return (
    <div>
      <Wrapper1 />
      <Wrapper2 state={fruits.length} />
    </div>
  );
}

export default App;
